import React from 'react';
import NavBar from '../components/NavBar';

const ProfilePage = () => {
    return (
        <>
            <NavBar />
            <div className='container mt-5'>
                <h1 className='text-red'>Profile Page</h1>   
            </div>
        
        </>
    );
};

export default ProfilePage;
